// import logo from './logo.svg';
import './App.css';


function MyButton() {
  return (
    <button className="Button">I'm a button</button>
  );
}

export default function App() {
  return (
    <div className="Button">
      <h1>Welcome to my app</h1>
      <MyButton />
    </div>
  );
}
